import React from "react";
import Contact from "./Contact";
function Footer() {
    return (
        <div id="footer">            
            <p id="footer">Adeola Ogundipe
            Contact Information
            3528 Gentian Blvd 
                Columbus, Georgia. 
                (678) 668-3880
                realdipe@gmail.com.</p>
            <p id="footer"><Contact /> </p>           
            <a href="https://www.linkedin.com/in/racheal-ogundipe/"> Linkedin </a>
        </div>
    );
}

export default Footer;
